    }

    function CancelSerByAdmin(id) {
        $.post(""/Admin/CancelService"", { Id: parseInt(id) },

            function (data) {
                if (data == true) {
                    $(""#AdminCancelSerModal"").modal('hide');
                    $(""#cancelModal"").modal('show');
